  const coordinates = { lat: 0, lng: 0 };
  return (
    <div sty>
      <p>Map</p>
      <GoogleMapReact
        bootstrapURLKeys={{ key: "AIzaSyBwwRjHA3A4j64wjjtRgKfhviBkvz9psYE" }}
        defaultCenter={coordinates}
        center={coordinates}
        defaultZoom={14}
        margin={[50, 50, 50, 50]}
      ></GoogleMapReact>
    </div>
  );
};

export default Map;
